import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./section2.css";

import jsResim from "../Assets/js.jpg";
import reactResim from "../Assets/react.jpg";
import reduxResim from "../Assets/redux.jpg";
import nodeResim from "../Assets/node.jpg";
import figmaResim from "../Assets/figma.jpg";
import vsResim from "../Assets/vs.jpg";

export default function Section1() {
  return (
    <>
      <section className="section2 flex justify-center">
        <div className="skills-title">Skills</div>
        <div className="skills-icons h-1/2 flex flex-row flex-wrap">
          <div className="skills-js w-1/2 h-1/5 flex items-center bg-slate-200">
            <img src={jsResim} className="h-full rounded-xl mr-5" />
            <span>JAVASCRIPT</span>
          </div>
          <div className="skills-node w-1/2 h-1/5 flex items-center">
            <img src={jsResim} className="h-full rounded-xl" />
            <span>NODE</span>
          </div>
          <div className="skills-react w-1/2 h-1/5 flex items-center">
            <img src={jsResim} className="h-full rounded-xl" />
            <span>REACT</span>
          </div>

          <div className="skills-vs w-1/2 h-1/5 flex items-center">
            <img src={jsResim} className="h-full rounded-xl" />
            <span>VS CODE</span>
          </div>
          <div className="skills-redux w-1/2 h-1/5 flex items-center">
            <img src={jsResim} className="h-full rounded-xl" />
            <span>REDUX</span>
          </div>
          <div className="skills-figma w-1/2 h-1/5 flex items-center">
            <img src={jsResim} className="h-full rounded-xl" />
            <span>FIGMA</span>
          </div>
        </div>
      </section>
    </>
  );
}
